(5680, 12, 'Rijksmuseum', 'Rijksmuseum (Stadhouderskade 42) . Aan de basis van dit gebouw staat de oprichting van een Commissie tot Stichting van een Museum Koning Willem I (1862). De eerste uitgeschreven prijsvraag (1863) leverde geen winnaar op, maar P.J.H. Cuypers werd tweede. Nadat de gemeente Amsterdam in 1873 had toegezegd haar schilderijenverzameling in bruikleen te geven, was er een uitgebreider ontwerp nodig. De daaropvolgende tweede prijsvraag (1875) werd wel gewonnen door Cuypers, die vervolgens &eacute;&eacute;n van zijn twee ingediende plannen uitwerkte tot het huidige gebouw. Dit tussen 1876 en 1885 verwezenlijkte museum kreeg een middenvleugel met onderdoorgang en aan weerszijden twee door vleugels omgeven binnenplaatsen. Aan de zuidwestkant bouwde men een bibliotheekuitbouw met ijzeren galerijen. De binnenplaatsen - voorzien van glazen kappen met vakwerkconstructies (sikkelspanten en trekstaven) - boden onderdak aan gipsafgietsels (westzijde) en de afdeling geschiedenis (oostzijde). Naast de overwelfde zalen van de begane grond werden kopie&euml;n gebouwd van onder meer de crypten van de kerken te Deventer en Maastricht. Op de verdieping richtte men een kopie in van de Aduardkapel. De bel-etage bevat een voorhal, een eregalerij en een Rembrandtzaal. De om de binnenplaatsen lopende enfiladen van zalen zijn aan de voorzijde voorzien van kabinetten.', 52.36, 4.88505, 'Amsterdam', 'Noord-Holland', 'Stadhouderskade', '1-42', '1885', 1885, 'Rijksmuseum Amsterdam', '{"commissie": 1, "omgeven": 1, "geschiedenis": 1, "door": 2, "amsterdam": 2, "werden": 1, "kopie": 1, "deventer": 1, "schilderijenverzameling": 1, "42": 1, "weerszijden": 1, "om": 1, "het": 1, "nadat": 1, "grond": 1, "gebouwd": 1, "geen": 1, "boden": 1, "afdeling": 1, "op": 2, "naast": 1, "&eacute": 2, "rembrandtzaal": 1, "museum": 2, "aan": 5, "meer": 1, "trekstaven": 1, "lopende": 1, "-": 2, "voorzijde": 1, "stadhouderskade": 1, "crypten": 1, "binnenplaatsen": 3, "gewonnen": 1, "rijksmuseum": 