(5941, 7, 'Paleis op de Dam', 'Het voorm. stadhuis, nu Koninklijk Paleis op de Dam (NZ Voorburgwal 147) werd in 1648-''65 in classicistische stijl gebouwd naar ontwerp van Jacob van Campen, ter vervanging van het middeleeuwse stadhuis (afgebrand 1652). Dit imposante blokvormige gebouw met twee symmetrisch gesitueerde binnenplaatsen werd in de tijd zelf wel het achtste wereldwonder genoemd. De met zandsteen beklede gevels hebben voor en achter ondiepe hoekrisalieten en een middenrisaliet met rijk versierd fronton. Boven de sokkelvormige begane grond worden de gevels geleed door twee gestapelde kolossale pilasterordes volgens het ordeboek van Scamozzi: romana (composiet) en corinthisch.', 52.3732, 4.89104, 'Amsterdam', 'Noord-Holland', 'Nieuwezijds Voorburgwal', '147', '1648-1665', 1665, 'Paleis op de Dam', '{"nu": 1, "koninklijk": 1, "pilasterordes": 1, "gebouw": 1, "volgens": 1, "door": 1, "amsterdam": 1, "nz": 1, "middeleeuwse": 1, "gesitueerde": 1, "ontwerp": 1, "werd": 2, "rijk": 1, "het": 4, "1648-''65": 1, "voor": 1, "middenrisaliet": 1, "gevels": 2, "grond": 1, "gebouwd": 1, "voorburgwal": 1, "ordeboek": 1, "kolossale": 1, "een": 1, "op": 2, "stijl": 1, "wereldwonder": 1, "versierd": 1, "jacob": 1, "corinthisch": 1, "1652": 1, "achtste": 1, "dam": 2, "tijd": 1, "binnenplaatsen": 1, "paleis": 2, "ter": 1, "imposante": 1, "van": 4, "achter": 1, "naar": 1, "hoekrisalieten": 1, "composiet": 1, "gestapelde": 1, "de": 6, "met": 3, "twee": 2, "romana": 1, "fronton": 1, "dit": 1, "beklede": 1, "hebben": 1, "symmetrisch": 1, "voorm": 1, "vervanging": 1, "classicistische": 1, "wel": 1, "worden": 1, "147": 1, "campen": 1, "scamozzi:": 1, "geleed": 1, "blokvormige": 1, "stadhuis": 2, "boven": 1, "in": 3, "begane": 1, "zelf": 1, "afgebrand": 1, "sokkelvormige": 1, "en": 3, "ondiepe": 1, "zandsteen": 1, "genoemd": 1}'),
(5989, 5, 'Hoofdpostkantoor', 'Postkantoren. In 1893-''99 verrees naar ontwerp van rijksbouwmeester C.H. Peters het voorm. hoofdpostkantoor (NZ Voorburgwal 182) in de voor zijn werk zo kenmerkende, op de neogotiek ge&euml;nte, vormen. Dit rijk geornamenteerde, forse drielaagse gebouw is voorzien van een reeks dakerkers en vier torens met peervormige spitsen. Twee torens met opengewerkte spitsen flankeren het ingangsrisaliet. Het gebouw is als warenhuis &lsquo;Magna Plaza&rsquo; in gebruik sinds een verbouwing in 1991-''92 (H. Ruijssenaars). De centrale hal met galerijen ontvangt licht door een (vernieuwde) lichtkap. Een sober expressionistisch ontwerp is het telefoongebouw (Singel 340; 1917-''19, G.J. Rutgers en P.L. Marnette) . Dit blokvormig pand heeft een gesloten, met natuursteen beklede, onderbouw en is versierd met beeld-houwwerk (H. Krop) en uitgebreid in 1955 (C. van der Wilk). Het voorm. rijkskantoor voor Geld- en Telefoonbedrijf (NZ Voorburgwal 226; 1924-''27, J. Crouwel) , nu kantoor van K.P.N. en winkelcentrum, is een zakelijk-expressionistisch gebouw met stalen kozijnen, plat dak, doorlopende overstekken en balkons. Het voorm. stationspostkantoor (Oosterdokskade 5; 1960-''68, P.J. Elling en B. Merkelbach) is opgetrokken met een betonskelet en bekleed met kalkzandsteen. Het bestaat uit een hoog rechthoekig bouwdeel (pakketpost en administratie) en een in 2004 gesloopt haaks ingestoken laag bouwdeel met betonnen schaaldaken (briefpost). Een deel van het gebouw dient momenteel als tijdelijke huisvesting van het Stedelijk Museum.', 52.3739, 4.89022, 'Amsterdam', 'Noord-Holland', 'Nieuwezijds Voorburgwal', '137-182', '1895-1888', 1888, NULL, '{"nu": 1, "opgetrokken": 1, "2004": 1, "spitsen": 2, "sober": 1, "stationspostkantoor": 1, "door": 1, "amsterdam": 1, "nz": 2, "onderbouw": 1, "ontvangt": 1, "huisvesting": 1, "bouwdeel": 2, "het": 9, "deel": 1, "ge&euml": 1, "g.j": 1, "gesloopt": 1, "voorburgwal": 2, "forse": 1, "op": 1, "verbouwing": 1, "versierd": 1,