(10235, 20, 'Het Kasteel', 'De Trip van Zoudtlandtkazerne (De la Reystraat 95/Lovensedijkstraat 10) uit 1910-''14, is opgezet voor de cavalerie. In de oorspronkelijke opzet had het twaalf eenlaags paviljoens. Opmerkelijk zijn de twee hoofdgebouwen (A en B) aan de app&egrave;lplaats en de voorm. paardenstallen, alle uit 1913. In 1922-''24 werd het complex uitgebreid met vijf paviljoens in aangepaste stijl. Scholen. De voorm. Hogere Burger School (Kasteelplein 10) heeft de vorm van een monumentaal eclectisch blokvormig herenhuis uit 1867. Sinds 1901 is het onderdeel van de Koninklijke Militaire Academie. Het R.K. Onze-Lieve-Vrouw-Lyceum (Paul Windhausenweg 11) uit 1918-''19 is gebouwd in de stijl van het kubistisch expressionisme. Het heeft een zeer markante, op de hoek gelegen ingang. De entreehal en het trappenhuis hebben art deco-elementen. Het geheel staat onder sterke invloed van de vormentaal van K.P.C. de Bazel. In 1952-''53 voegde men naar ontwerp van J. Bunnik de tweede verdieping toe. De Beeldenaar (Keizerstraat 1), een schoolgebouw voor Lager Onderwijs, verrees in 1920 in de stijl van het kubistisch expressionisme, naar ontwerp van de dienst Openbare Werken. Lagere School De Kastanjeboom (Boeimeersingel 14-14A) uit 1934 toont invloeden van Dudok. Het werd ontworpen door F. Verwoerd en J. Temme. Het Prins Willem I-paviljoen is een onderwijsgebouw van de K.M.A. Breda, Hofhuizen aan de Catharinastraat (nrs. 18-28), situatie circa 1550 en circa 1950 (Kasteelplein 10) uit 1938-''42, gebouwd in de trant van de Delftse School.', 51.5914, 4.7746, 'Breda', 'Noord-Brabant', 'Kasteelplein', '10', NULL, NULL, 'Kasteel van Breda', '{"verwoerd": 1, "academie": 1, "sterke": 1, "geheel": 1, "1952-''53": 1, "door": 1, "entreehal": 1, "aangepaste": 1, "hoek": 1, "opmerkelijk": 1, "onze-lieve-vrouw-lyceum": 1, "onderwijsgebouw": 1, "95/lovensedijkstraat": 1, "het": 12, "eclectisch": 1, "reystraat": 1, "gebouwd": 2, "kasteelplein": 2, "ontworpen": 1, "op": 1, "invloeden": 1, "