(11872, 22, 'Nieuwe Kerk', 'De (Herv.) Nieuwe of St.-Ursulakerk (Markt 80) is een driebeukige basilicale kruiskerk met kooromgang, doopkapel en een zeer rijzige toren. Op de plaats van een miraculeuze verschijning van de H. Maagd werd in 1381 een kleine houten kerk gesticht. In baksteen verrezen in 1383-''90 ten oosten daarvan een dwarsschip en koor, waarvan alleen het dwarsschip over is met inwendig aanzetten voor - waarschijnlijk nooit uitgevoerde - stenen gewelven. In 1412 begon de bouw van een basilicaal schip met schijntriforium en op de zijbeuken aansluitende reeksen zijkapellen. Nadat in 1420 de houten noodkerk was weggebroken, kwam dit gotische schip in 1435 gereed. Onder leiding van Utrechtse Dombouwmeester Jacob van der Borch begon men in 1453 met de bouw van een gotische kooromgang met sacristie (en daarboven een librije). De sloop van het oude koor volgde in 1465. Op de fundamenten plaatste men natuurstenen zuilen met koolbladkapitelen om de door speklagen versierde koorlantaarn te dragen (inwendig met vensterbanktriforium). De kap en het houten tongewelf waren in 1471 gereed en nadat de stenen gewelven in de kooromgang waren geslagen, volgde in 1476 de wijding van het nieuwe koor. De lage kluis (met tralieramen) aan de zuidzijde is laat-15de-eeuws en in die tijd werd ook de vloer van het dwarsschip opgehoogd, waardoor de basementen van de vieringpijlers uit het zicht verdwenen. Rond 1485 trok men de zuiderzijbeuk langs de toren westwaarts door en aansluitend verrees daar een driezijdig gesloten doopkapel. Het noordtransept werd in 1510 uitgebreid met een Mariakapel. Anthonis Keldermans was ook betrokken bij de in navolging van de Oude Kerk geplande verlenging van het zuidtransept; maar dat werk kwam in 1512 niet verder dan de fundering. Na de kerkbrand van 1536 heeft men in 1540-''49 de stenen gewelven en de scheidingen tussen de kapellen weggebroken en zijn de huidige zeer brede zijbeuken met houten tongewelven ontstaan. De portalen aan zuid- en noordzijde werden in 1546 en 1549 hersteld of vernieuwd; het torenportaal volgde in 1556. Herstellingen aan de kerk vonden verder plaats in 1655 (na de buskruitramp) en in 1837-''41.', 52.0123, 4.3608, 'Delft', 'Zuid-Holland', 'Markt', '80', '1396-1496 (toren)', 1496, 'Nieuwe Kerk (Delft)', '{"houten": 4, "weggebroken": 2, "1476": 1, "doopkapel": 2, "natuurstenen": 1, "1412": 1, "kruiskerk": 1, "leiding": 1, "door": 2, "werden": 1, "navolging": 1, "koolbladkapitelen": 1, "nooit": 1, "of": 2, "over": 1, "verschijning": 1, "het": 9, "om": 1, "verlenging": 1, "nadat": 2, "laat-15de-eeuws": 1, "1420": 1, "1540-''49": 1, "opgehoogd": 1, "1485": 1, "zuidtransept": 1, "kap": 1, "op": 3, "ook": 2, "dombouwmeester": 1, "st.-ursulakerk": 1, "basementen": 1, "tralieramen": 1, "sloop": 1, "trok": 1, "alleen": 1, "aan": 3, "kluis": 1, "vieringpijlers": 1, "verrezen": 1, "-": 2, "1381": 1, "geslagen": 1, "1512": 1, "1510": 1, "baksteen": 1, "waarvan": 1, "begon": 2, "tongewelven": 1, "1383-''90": 1, "gotische": 2, "vonden": 1, "ontstaan": 1, "lage": 1, "noordzijde": 1, "bij": 1, "oosten": 1, "der": 1, "1435": 1, "1453": 1, "huidige": 1, "aansluitend": 1, "schip": 2, "reeksen": 1, "zuiderzijbeuk": 1, "aanzetten": 1, "buskruitramp": 1, "koorlantaarn": 1, "versierde": 1, "schijntriforium": 1, "de": 32, "westwaarts": 1, "kerkbrand": 1, "driezijdig": 1, "wijding": 1, "zijbeuken": 2, "herstellingen": 1, "kapellen": 1, "anthonis": 1, "betrokken": 1, "plaatste": 1, "portalen": 1, "1465": 1, "kooromgang": 3, "oude": 2, "gesticht": 1, "vloer": 1, "h": 1, "dragen": 1, "waardoor": 1, "heeft": 1, "hersteld": 1, "na": 2, "fundamenten": 1, "1837-''41": 1, "en": 13, "1471": 1, "stenen": 3, "zeer": 2, "ten": 1, "markt": 1, "maar": 1, "geplande": 1, "gesloten": 1, "verrees": 1, "te": 1, "kleine": 1, "kerk": 4, "nieuwe": 3, "werd": 3, "werk": 1, "noordtransept": 1, "aansluitende": 1, "langs": 1, "waren": 2, "herv": 1, "borch": 1, "voor": 1, "daarvan": 1, "80": 1, "daarboven": 1, "delft": 1, "brede": 1, "