(12572, 25, 'Grote of St. LebuÃ¯nuskerk', 'De (Herv.) Grote of St.-Lebu&iuml;nuskerk (Grote Kerkhof 42) is een ruime laatgotische hallenkerk met kooromgang en een romaanse crypte; de forse toren heeft twee geledingen en een achtkantige lantaarn. Noch van het kerkje dat omstreeks 770 door Lebu&iuml;nus werd gesticht, noch van de beide kerkjes van kort na 775 en na 881 zijn sporen teruggevonden. De kern van het huidige gebouw is een zeer grote vroegromaanse kapittelkerk die kort na 1046 door de Utrechtse bisschop Bernold werd gesticht. Deze niet-overwelfde basiliek - geheel gebouwd in tufsteen - kwam in &eacute;&eacute;n bouwfase tot stand. Ze bestond uit een oostelijk dwarsschip en koor met een gedeeltelijk verzonken crypte, waarboven een hoogkoor was, aan beide zijden geflankeerd door een zijkoor. Aan de westzijde bevond zich eveneens een dwarsschip met daartegen aangebouwd een westwerk bestaande uit twee romaanse westtorens, aan beide zijden geflankeerd door lagere traptorens. Tussen beide torens zal zich een lage ingangshal hebben bevonden, waarboven een ruimte was met uitzicht op het schip. Tijdens opgravingen in 1961-''62 zijn hiervan de funderingen blootgelegd. Over de juiste reconstructie van dit westwerk verschillen de meningen en dat geldt ook voor de interpretatie van de functie, waarbij vergelijkingen zijn gemaakt met zowel de Dom van Verdun als de St.-Gertrudiskerk te Nijvel. Het basilicale schip zou naar de huidige inzichten oorspronkelijk een indeling hebben gekend met zes scheibogen ondersteund door vijf rode zandstenen zuilen, zoals die nu nog te vinden zijn in de eveneens door Bernold gestichte kleinere, maar verder zeer vergelijkbare, St.-Pieterskerk te Utrecht. Meer is bekend over de lichtbeuk, waarvan resten boven de huidige gewelven bewaard zijn gebleven en op grond waarvan aan beide zijden acht rondboogvensters gereconstrueerd kunnen worden. Ook de noordwand van het westelijke dwarsschip, waarin zich een toegang naar het bisschopshof bevond, de bijbehorende oostelijke kruispijlers, evenals de noordwand van het oostelijke dwarsschip en de vier kruispijlers zijn bewaard gebleven. Het veruit belangrijkste 11de-eeuwse restant is evenwel de crypte. De ribloze kruisgewelven van de crypte worden gedragen door twee rijen van elk drie zuilen. De zuilen hebben teerlingkapitelen en spiraalvormig gegroefde of geschubde schachten uit Nivelsteiner zandsteen. De absis van de crypte, waarin een 11de-eeuws venster zit, is inwendig halfrond en uitwendig driezijdig gesloten. Toegang tot de crypte had men vanuit de lage zijkoren, waarvan de vloerhoogte ongeveer overeenkomt met het bordes van de huidige toegangstrap. In de crypte bevindt zich nog een put die in verbinding staat met de IJssel, enkele nissen en een later altaar. De muurschilderingen in de crypte, met een voorstelling van de vier aartsengelen die de Arma Christi dragen, stammen uit de 15de eeuw en mogelijk van kort na 1468.', 52.252, 6.15522, 'Deventer', 'Overijssel', 'Grote Kerkhof', '42', NULL, NULL, 'Grote of LebuÃ¯nuskerk', '{"bevonden": 1, "verdun": 1, "dom": 1, "bewaard": 2, "toegangstrap": 1, "ruime": 1, "rijen": 1, "st.-lebu&iuml": 1, "over": 2, "42": 1, "voorstelling": 1, "enkele": 1, "kerkje": 1, "grond": 1, "funderingen": 1, "gebouwd": 1, "gereconstrueerd": 1, "uitzicht": 1, "1961-''62": 1, "meer": 1, "-": 2, "aangebouwd": 1, "blootgelegd": 1, "st.-gertrudiskerk": 1, "kort": 3, "lage": 2, "vier": 2, "huidige": 4, "kerkjes": 1, "indeling": 1, "westwerk": 2, "laatgotische": 1, "drie": 1, "eeuw": 1, "tijdens": 1, "de": 38, "kunnen": 1, "nuskerk": 1, "twee": 3, "verschillen": 1, "gedeeltelijk": 1, "bisschop": 1, "hebben": 3, "vanuit": 1, "bernold": 2, "juiste": 1, "ribloze": 1, "1468": 1, "worden": 2, "belangrijkste": 1, "zijkoor": 1, "stammen": 1, "later": 1, "n": 1, "functie": 1, "vergelijkbare": 1, "gegroefde": 1, "gesticht": 2, "heeft": 1, "teruggevonden": 1, "zes": 1, "sporen": 1, "oorspronkelijk": 1, "zandstenen": 1, "nus": 1, "basiliek": 1, "en": 11, "gekend": 1, "lebu&iuml": 1, "utrecht": 1, "crypte": 8, "noordwand": 2, "zeer": 2, "hallenkerk": 1, "lebuã¯nuskerk": 1, "gebouw": 1, "geflankeerd": 2, "kern": 1, "lichtbeuk": 1, "waarin": 2, "tufsteen": 1, "te": 3, "bijbehorende": 1, "zijkoren": 1, "kruisgewelven": 1, "voor": 1, "st": 1, "bevindt": 1, "had": 1, "schachten": 1, "westtorens": 1, "een": 18, "overeenkomt": 1, "hoogkoor": 1, "dat": 2, "omstreeks": 1, "westzijde": 1, "gedragen": 1, "beide": 5, "restant": 1, "van": 15, "basilicale": 1, "bekend": 1, "verbinding": 1, "zijden": 3, "met": 9, "tussen": 1, "zich": 4, "tot": 2, "geldt": 1, "koor": 1, "als": 1, "verder": 1, "men": 1, "zoals": 1, "spiraalvormig": 1, "acht": 1, "opgravingen": 1, "gestichte": 1, "romaanse": 2, "gewelven": 1, "muurschilderingen": 1, "stand": 1, "zal": 1, "vloerhoogte": 1, "utrechtse": 1, "traptorens": 1, "gebleven": 2, "uitwendig": 1, "nu": 1, "veruit": 1, "resten": 1, "geheel": 1, "rondboogvensters": 1, "door": 7, "evenals": 1, "deventer": 1, "kleinere": 1, "rode": 1, "of": 3, "bestond": 1, "het": 9, "gemaakt": 1, "ingangshal": 1, "bordes": 1, "881": 1, "11de-eeuws": 1, "forse": 1, "op": 2, "nog": 2, "ook": 2, "elk": 1, "&eacute": 2, "aan": 4, "waarbij": 1, "teerlingkapitelen": 1, "zou": 1, "nijvel": 1, "evenwel": 1, "waarvan": 3, "kerkhof": 1, "verzonken": 1, "lantaarn": 1, "christi": 1, "eveneens": 2, "put": 1, "oostelijk": 1, "schip": 2, "naar": 2, "zowel": 1, "bouwfase": 1, "interpretatie": 1, "reconstructie": 1, "absis": 1, "ijssel": 1, "driezijdig": 1, "niet-overwelfde": 1, "waarboven": 2, "bisschopshof": 1, "halfrond": 1, "vroegromaanse": 1, "kruispijlers": 2, "geledingen": 1, "11de-eeuwse": 1, "bevond": 2, "15de": 1, "kooromgang": 1, "staat": 1, "boven": 1, "nivelsteiner": 1, "meningen": 1, "dragen": 1, "noch": 2, "altaar": 1, "na": 4, "mogelijk": 1, "scheibogen": 1, "ongeveer": 1, "ondersteund": 1, "zandsteen": 1, "bestaande": 1, "maar": 1, "gesloten": 1, "1046": 1, "achtkantige": 1, "werd": 2, "lagere": 1, "herv": 1, "dez