(15669, 30, 'Planetarium Eise Eisinga, planetarium', 'Het planetarium (Eise Eisingastraat 3) is gehuisvest in een eenlaagspand met klokgevel uit 1768. In 1774-''81 bracht de sterrenkundige Eise Eisinga hier in de woonkamer een schaalmodel van het zonnestelsel aan tegen een blauw geschilderd houten plafond. De mechanische aandrijving van het model bevindt zich op zolder. Het huis is nu een museum.', 53.1875, 5.54379, 'Franeker', 'Friesland', 'Eise Eisingastraat', '3', '1774-1781', 1781, 'Planetarium Eise Eisinga', '{"nu": 1, "houten": 1, "model": 1, "van": 2, "sterrenkundige": 1, "zonnestelsel": 1, "eisingastraat": 1, "gehuisvest": 1, "1768": 1, "klokgevel": 1, "de": 3, "met": 1, "zich": 1, "eisinga": 2, "woonkamer": 1, "plafond": 1, "het": 4, "planetarium": 3, "franeker": 1, "1774-''81": 1, "bevindt": 1, "bracht": 1, "is": 2, "eenlaagspand": 1, "op": 1, "een": 4, "schaalmodel": 1, "huis": 1, "museum": 1, "aan": 1, "in": 3, "3": 1, "aandrijving": 1, "uit": 1, "eise": 3, "hier": 1, "mechanische": 1, "zolder": 1, "tegen": 1, "blauw": 1, "geschilderd": 1}'),
