(17604, 41, 'Oud-Kath. Kerk v.d. H. Augustinus', 'De (Oud Kath.) H.H. Jacobus en Augustinuskerk (Juffrouw Idastraat 7a) werd in 1720-''22 gebouwd als schuilkerk. Het als sobere herenhuisgevel opgebouwde front heeft een omlijste ingang met een portret van Augustinus. Het vermoedelijk door Dani&euml;l Marot ontworpen interieur is uitgevoerd onder leiding van Nicolaas ''s-Gravenhage, Portugees-Isr. synagoge Kruysselbergen en heeft rijk stucwerk in Lodewijk XIV-vormen bij het koofplafond en de wanden met corinthische pilasters. Tot de oorspronkelijke inventaris, grotendeels vervaardigd door Jan Baptist Xavery, behoren een communiebank, een preekstoel (1729) en een wit marmeren doopvont. Verder bevat de kerk een rijk gesneden hoogaltaar met een altaarstuk van Matheus Terwesten (1733) en een door Rudolf Garrels gebouwd orgel (1726; gerestaureerd 1994-''95). De bijbehorende voorm. pastorie (Juffrouw Idastraat 13), met 17de-eeuwse kern en zolderkerk, is grotendeels vernieuwd in 1949-''50.', 52.0794, 4.30618, '''s-Gravenhage', 'Zuid-Holland', 'Juffrouw Idastraat', '7', '1722 (interieur)', 1722, NULL, '{"communiebank": 1, "xiv-vormen": 1, "synagoge": 1, "wanden": 1, "kath": 1, "portret": 1, "marmeren": 1, "kern": 1, "oud": 1, "door": 3, "marot": 1, "leiding": 1, "sobere": 1, "bijbehorende": 1, "kerk": 2, "zolderkerk": 1, "inventaris": 1, "1729": 1, "werd": 1, "1726": 1, "xavery": 1, "matheus": 1, "grotendeels": 2, "rijk": 2, "het": 3, "jan": 1, "vermoedelijk": 1, "koofplafond": 1, "dani&euml": 1, "17de-eeuwse": 1, "gebouwd": 2, "1720-''22": 1, "oud-kath": 1, "een": 8, "ontworpen": 1, "h.h": 1, "vervaardigd": 1, "augustinus": 2, "terwesten": 1, "pastorie": 1, "oorspronkelijke": 1, "juffrouw": 2, "bij": 1, "augustinuskerk": 1, "van": 3, "opgebouwde": 1, "baptist": 1, "herenhuisgevel": 1, "portugees-isr": 1, "13": 1, "idastraat": 2, "gesneden": 1, "de": 5, "met": 4, "tot": 1, "pilasters": 1, "wit": 1, "bevat": 1, "corinthische": 1, "als": 2, "garrels": 1, "verder": 1, "voorm": 1