(19938, 50, 'Bisdom van Vliet', 'Huis Bisdom van Vliet (Hoogstraat 166). Dit zeer forse tweelaags pand in eclectische vormen werd in 1874-''77 gebouwd in opdracht van Marcellus Bisdom van Vliet (&dagger; 1877) ter plaatse van een 18de-eeuwse voorganger. De rijk uitgevoerde gevel risaleert asymmetrisch maar heeft in het midden een ingangspartij met segmentvormig fronton. Een mezzanino en kroonlijst met gesneden koppen als consoles dragen de attiek. De weelderige stucwerkdecoraties in het interieur zijn naar ontwerp van F.P.C Schild en uitgevoerd door Th. Hooft en C. Straver. De dochter P.M. Lef&egrave;vre de Montigny-Bisdom van Vliet legateerde het huis bij haar overlijden in 1923 als museum aan de Stichting Bisdom van Vliet.', 52.0012, 4.77125, 'Haastrecht', 'Zuid-Holland', 'Hoogstraat', '166', 'derde kwart 19e eeuw', 1900, 'Museum Bisdom van Vliet', '{"zeer": 1, "montigny-bisdom": 1, "asymmetrisch": 1, "1874-''77": 1, "p.m": 1, "maar": 1, "stichting": 1, "door": 1, "th": 1, "ontwerp": 1, "werd": 1, "rijk": 1, "het": 3, "lef&egrave": 1, "gebouwd": 1, "segmentvormig": 1, "een": 3, "forse": 1, "koppen": 1, "museum": 1, "aan": 1, "166": 1, "overlijden": 1, "consoles": 1, "vre": 1, "bisdom": 4, "plaatse": 1, "tweelaags": 1, "ter": 1, "vliet": 5, "bij": 1, "van": 8, "&dagger": 1, "naar": 1, "haar": 1, "straver": 1, "midden": 1, "attiek": 1, "zijn": 1, "stucwerkdecoraties": 1, "marcellus": 1, "legateerde": 1, "dochter": 1, "schild": 1, "haastrecht": 1, "vormen": 1, "de": 6, "gesneden": 1, "met": 2, "voorganger": 1, "ingangspartij": 1, "f.p.c": 1, "dit": 1, "fronton": 1, "als": 2, "mezzanino": 1, "risaleert": 1, "pand": 1, "kroonlijst": 1, "weelderige": 1, "gevel": 1, "eclectische": 1, "c": 1, "uitgevoerd": 1, "opdracht": 1, "hooft": 1, "1877": 1, "huis": 2, "uitgevoerde": 1, "1923": 1, "in": 6, "dragen": 1, "heeft": 1, "hoogstraat": 1, "en": 3, "interieur": 1, "18de-eeuwse": 1}'),
(20129, 55, 'Hervormde Kerk IJsselstein', 'De Herv. kerk (Kronenburgplantsoen 2), oorspronkelijk St.-Nicolaaskerk, is in 1309 door Gijsbrecht van IJsselstein gesticht als parochiekerk en werd in 1397 kapittelkerk. Het is een ruime, laat-gotische kruiskerk met pseudo-basilicaal schip, een koor met omgang en een westtoren in vroege renaissance-stijl, voorzien van een bekroning in de stijl van de Amsterdamse School. Waarschijnlijk vanwege de verwoesting van de stad in 1466 heeft men de kerk volledig herbouwd; ze dateert in hoofdzaak uit het einde van de 15de eeuw. Waarschijnlijk kort na 1500 is de kooromgang nog veranderd. In het begin van de jaren dertig van de 16de eeuw verrees de toren. In 1911 brandden toren en kerk geheel uit. Het herstel van de kerk, onder leiding van J.F.L. Frowein, voltooide men in 1916; de toren werd pas in 1925-''28 hersteld.', 52.021, 5.04528, 'IJsselstein', 'Utrecht', 'Kronenburgplantsoen', '2', '1310-1923', 1923, 'Hervormde Kerk IJsselstein', '{"omgang": 1, "geheel": 1, "leiding": 1, "door": 1, "kruiskerk": 1, "verrees": 1, "ruime": 1, "parochiekerk": 1, "kerk": 5, "einde": 1, "laat-gotische": 1, "werd": 2, "westtoren": 1, "het": 4, "herv": 1, "1925-''28": 1, "vanwege": 1, "herstel": 1, "voltooide": 1, "nog": 1, "een": 4, "stijl": 1, "dertig": 1, "2": 1, "uit": 2, "waarschijnlijk": 2, "st.-nicolaaskerk": 1, "kort": 1, "hervormde": 1, "herbouwd": 1, "jaren": 1, "bekroning": 1, "verwoesting": 1, "van": 9, "brandden": 1, "schip": 1, "pseudo-basilicaal": 1, "voorzien": 1, "ze": 1, "gijsbrecht": 1, "1916": 1, "1911": 1, "volledig": 1, "eeuw": 2, "de": 13, "met": 2, "pas": 1, "1500": 1, "koor": 1, "als": 1, "vroege": 1, "ijsselstein": 3, "men": 2, "is": 3, "1309": 1, "1466": 1, "kooromgang": 1, "15de": 1, "frowein": 1, "toren": 3, "j.f.l": 1, "gesticht": 1, "in": 10, "veranderd": 1, "16de": 1, "begin": 1, "1397": 1, "kronenburgplantsoen": 1, "heeft": 1, "hersteld": 1, "kapittelkerk": 1, "na": 1, "school": 1, "oorspronkelijk": 1, "amsterdamse": 1