(23110, 56, 'Stadhuis van Kampen', 'Van het stadhuis (Oudestraat 133) bestaat het oudste deel uit een rijzig laat-gotisch bouwdeel met zadeldak tussen rijk versierde puntgevels met nissengeleding, pinakels en arkeltorentjes met ingesnoerde spits. Beide topgevels hebben een gedraaide toppinakel, die tevens als schoorsteenkanaal dient. De topgevel aan de zuidzijde is door een latere aanbouw grotendeels uit het zicht geraakt; hier bevindt zich nog wel een zonnewijzer uit 1615. Aan de oostzijde staat de Schepentoren, met een vierkante onderbouw, een omgang met kantelen en een achtzijdige bovenbouw bekroond met een zandstenen balustrade en een opengewerkte uivormige spits. Het gebouw gaat terug tot het midden van de 14de eeuw, maar na een felle brand in 1543 heeft men bij het herstel renaissance-elementen aan het gebouw toegevoegd. Van dit herstel dateren onder meer de overkragende, opengewerkte balustrade langs de dakranden en de balustrade van de Schepentoren. Twee verdiepingsvensters, het ene aan de voorzijde en het andere aan de achterzijde, hebben gesmede vensterkorven. Het gebouw heeft een souterrain met kruisgewelven. De bel-etage was vroeger toegankelijk via een bordestrap en deur in het midden van de voorgevel, maar deze zijn weggehaald bij de laat-19de-eeuwse restauratie. Naar plannen van P.J.H. Cuypers werden in 1894-1901 de noord- en de westgevel en in 1913-''15 de oostgevel en de Schepentoren aangepakt. De 15de-eeuwse beelden van de voorgevel verving men in 1933-''38 door nieuwe exemplaren van J. Polet. Net als de voorgangers stellen zij voor: Karel de Grote, Alexander de Grote, de Matigheid, de Trouw, de Gerechtigheid en de Barmhartigheid. De baldakijnen boven de beelden dateren van de restauratie. Boven het houten gewelf van de Schepenzaal werd in 1940 ter versterking een betonkap aangebracht. Aan dat gewelf en de kapconstructie daarboven, alsmede aan de balustrade van de voorgevel Kampen, Stadhuis, Schepenzaal en de spits van de Schepentoren zijn omstreeks 1979 nog restauratiewerkzaamheden uitgevoerd. In de toren hangt een klok uit 1499.', 52.5588, 5.91664, 'Kampen', 'Overijssel', 'Oudestraat', '133', '1345-1350', 1350, 'Stadhuis van Kampen', '{"houten": 1, "stellen": 1, "via": 1, "balustrade": 4, "deur": 1, "door": 2, "werden": 1, "klok": 1, "onderbouw": 1, "tevens": 1, "nissengeleding": 1, "het": 12, "bouwdeel": 1, "aangebracht": 1, "deel": 1, "1979": 1, "schoorsteenkanaal": 1, "voor:": 1, "nog": 2, "topgevels": 1, "schepentoren": 4, "aan": 7, "schepenzaal": 2, "latere": 1, "meer": 1, "andere": 1, "gewelf": 2, "1913-''15": 1, "1615": 1, "laat-19de-eeuwse": 1, "bekroond": 1, "gedraaide": 1, "oudestraat": 1, "voorzijde": 1, "hier": 1, "kapconstructie": 1, "bij": 2, "uivormige": 1, "naar": 1, "bel-etage": 1, "versierde": 1, "oostzijde": 1, "terug": 1, "net": 1, "toegankelijk": 1, "hangt": 1, "puntgevels": 1, "eeuw": 1, "de": 37, "karel": 1, "twee": 1, "matigheid": 1, "ene": 1, "opengewerkte": 2, "hebben": 2, "p.j.h": 1, "wel": 1, "alsmede": 1, "trouw": 1, "betonkap": 1, "alexander": 1, "toppinakel": 1, "staat": 1, "felle": 1, "boven": 2, "j": 1, "exemplaren": 1, "westgevel": 1, "vroeger": 1, "heeft": 2, "na": 1, "renaissance-elementen": 1, "overkragende": 1, "zandstenen": 1, "restauratie": 2, "brand": 1, "en": 12, "kantelen": 1, "beelden": 2, "gesmede": 1, "gaat": 1, "omgang": 1, "kampen": 3, "maar": 2, "achtzijdige": 1, "gebouw": 3, "aanbouw": 1, "dateren": 2, "versterking": 1, "noord-": 1, "weggehaald": 1, "restauratiewerkzaamheden": 1, "cuypers": 1, "toegevoegd": 1, "kruisgewelven": 1, "nieuwe": 1, "werd": 1, "bestaat": 1, "grotendeels": 1, "rijk": 1, "langs": 1, "daarboven": 1, "bevindt": 1, "rijzig": 1, "herstel": 2, "baldakijnen": 1, "deze": 1, "een": 14, "ingesnoerde": 1, "bordestrap": 1, "zonnewijzer": 1, "1940": 1, "omstreeks": 1, "dat": 1, "uit": 4, "gerechtigheid": 1, "geraakt": 1, "spits": 3, "beide": 1, "ter": 1, "vierkante": 1, "van": 13, "133": 1, "zadeldak": 1, "dakranden": 1, "oostgevel": 1, "arkelto