(26265, 63, 'Petrus en Pauluskerk', 'De Herv. kerk (Kerkpad 1), oorspronkelijk gewijd aan St. Petrus en St. Paulus, is een grote kruiskerk met vijfzijdig gesloten koor, zijkapellen en een forse toren van drie geledingen met zadeldak. Nadat een brand in 1217 de eerste kerk had verwoest, verrees een eenbeukige romaanse tufstenen kerk met recht gesloten koor. Van de oudste kerk zijn nog enkele muurdelen bewaard gebleven, waaronder een laag venster. In het derde kwart van de 13de eeuw verhoogde men het schip en verving men het bestaande koor door een dwarsschip met nieuw koor; van deze bouwfase resteren de beide dwarsarmen met hun meloenvormige koepelgewelven. De noordelijke topgevel is in later tijd verdwenen, de zuidelijke topgevel is aan het eind van de 15de eeuw vernieuwd. In de tweede helft van de 14de eeuw verrees de forse toren, die even breed is als het schip en onderaan bijna drie meter dikke muren heeft. De toren werd in 1610 hersteld. In de toren hangen twee klokken, uit 1397 en uit 1548; de laatste is gegoten door Geert van Wou (II).', 53.332, 6.74793, 'Loppersum', 'Groningen', 'Kerkpad', '8', 'na 1217', 1217, 'Petrus en Pauluskerk (Loppersum)', '{"gegoten": 1, "bewaard": 1, "kruiskerk": 1, "door": 2, "klokken": 1, "meter": 1, "het": 5, "nieuw": 1, "nadat": 1, "enkele": 1, "bijna": 1, "nog": 1, "forse": 2, "koepelgewelven": 1, "aan": 2, "noordelijke": 1, "1": 1, "helft": 1, "meloenvormige": 1, "1610": 1, "13de": 1, "resteren": 1, "muren": 1, "schip": 2, "verhoogde": 1, "bouwfase": 1, "drie": 2, "eeuw": 3, "dwarsarmen": 1, "de": 14, "twee": 1, "verwoest": 1, "vijfzijdig": 1, "laag": 1, "geledingen": 1, "hun": 1, "eerste": 1, "later": 1, "15de": 1, "onderaan": 1, "loppersum": 1, "1397": 1, "heeft": 1, "hersteld": 1, "muurdelen": 1, "oorspronkelijk": 1, "brand": 1, "en": 6, "zuidelijke": 1, "breed": 1, "dikke": 1, "bestaande": 1, "tweede": 1, "gesloten": 2, "verrees": 2, "kerk": 4, "paulus": 1, "eenbeukige": 1, "werd": 1, "herv": 1, "st": 2, "eind": 1, "had": 1