(27168, 67, 'Sint-Servaasbasiliek', 'De R.K. St.-Servaasbasiliek (Keizer Karelplein 6) is een imposante, grotendeels in kolenzandsteen opgetrokken, driebeukige kruisbasiliek voorzien van een rond gesloten koorpartij met twee slanke koortorens van vijf geledingen met tentdak. Verder heeft de kerk kapellenreeksen aan de noord- en de zuidzijde van het schip, een groot portaal met voorhal aan de zuidwestzijde en een zeer fors westwerk met twee torens voorzien van een bekroning met houten lantaarn en spits met frontalen.', 50.8493, 5.68668, 'Maastricht', 'Limburg', 'Keizer Karelplein', '6', 'Vanaf 11e eeuw', 1100, 'Sint-Servaasbasiliek (Maastricht)', '{"zeer": 1, "houten": 1, "opgetrokken": 1, "gesloten": 1, "r.k": 1, "voorhal": 1, "noord-": 1, "zuidwestzijde": 1, "kerk": 1, "koortorens": 1, "st.-servaasbasiliek": 1, "grotendeels": 1, "het": 1, "portaal": 1, "een": 5, "vijf": 1, "fors": 1, "aan": 2, "frontalen": 1, "driebeukige": 1, "slanke": 1, "6": 1, "maastricht": 1, "spits": 1, "imposante": 1, "bekroning": 1, "lantaarn": 1, "van": 4, "schip": 1, "voorzien": 2, "westwerk": 1, "de": 5, "kolenzandsteen": 1, "tentdak": 1, "met": 6, "rond": 1, "twee": 2, "kruisbasiliek": 1, "verder": 1, "karelplein": 1, "zuidzijde": 1, "keizer": 1, "is": 1, "geledingen": 1, "koorpartij": 1, "sint-servaasbasiliek": 1, "in": 1, "heeft": 1, "groot": 1, "kapellenreeksen": 1, "torens": 1, "en": 3}'),
(27382, 68, 'Stadhuis van Maastricht', 'Het stadhuis (Markt 78) is een groot vrijstaand, vierkant bouwwerk met hoog souterrain en hardstenen gevels, gebouwd in 1659-''64 voor de huisvesting van het Luikse en Brabantse Hooggerecht en het Laaggerecht. In de tweelaags onderbouw werden de vet-, mouten korenwaag, de wijnkelder, de gevangenis, de stadstimmerwerf en enkele wachtlokalen ondergebracht. Het oorspronkelijke classicistische ontwerp van Pieter Post is bij de uitvoering onder leiding van stadsbouwmeester Cornelis Pesser deels gewijzigd. De achter- en zijgevels hebben pilasters bij de middenpartijen, de voorgevel heeft pilasterstellingen met dorische pilasters bij de beletage en ionische pilasters bij de verdieping. De entree bestaat uit een monumentale trappartij met groot portiek en bordes. De verhoogde middengevel wordt bekroond door een fronton met stadsengel en stadswapen en geflankeerd door beelden van Mars en Minerva. De midden op het dak geplaatste klokkentoren werd in 1684 voltooid onder leiding van Adam Wijnandts. Hierin hangt een carillon met 17 klokken van Francois Hemony (1663-''64), waaraan bij de restauratie in 1962 nog 11 klokken van Van den Gheijn (1767-''69) en 15 nieuwe klokken zijn toegevoegd. In 1839 zijn de vensterkruizen vervangen door empireramen. Bij een verbouwing in 1861 heeft men de forse hoekschoorstenen verwijderd en het binnendakschild van het omlopend schilddak opgetrokken tot de torenvoet, waardoor de ronde vensters in de onderliggende koepel geen licht meer ontvangen.', 50.8507, 5.69045, 'Maastricht', 'Limburg', 'Markt', '78', '1659/1664 - 1684', 1664, 'Stadhuis van Maastricht', '{"portiek": 1, "opgetrokken": 1, "gewijzigd": 1, "korenwaag": 1, "leiding": 2, "door": 3, "klokken": 3, "werden": 1, "waaraan": 1, "hardstenen": 1, "onderbouw": 1, "stadstimmerwerf": 1, "luikse": 1, "huisvesting": 1, "het": 7, "bouwwerk": 1, "wijnkelder": 1, "gevangenis": 1, "bordes": 1, "geplaatste": 1, "enkele": 1, "ronde": 1, "gebouwd": 1, "geen": 1, "