(33753, 62, 'Voormalige parochiekerk', 'De oude R.K. St.-Salviuskerk (Platz 2) is een tweebeukige kerk met vijfzijdig gesloten koor en een toren van drie geledingen met ingesnoerde spits. Het oudste gedeelte is de deels in maaskeien opgetrokken 11de-eeuwse noordmuur met een (dichtgemetseld) romaans poortje. Ook het koor heeft enkele 11de-eeuwse muurdelen van maaskeien maar is rond 1250 grotendeels in mergelsteen opgetrokken in laat-romaanse stijl, met boogfriezen en driepasbogen bij de vensters. De bijbehorende sporenkap is bewaard gebleven. De mergelstenen toren verrees rond 1450. In het eerste kwart van de 16de eeuw werd de grotendeels in mergel uitgevoerde zuidbeuk toegevoegd en werd de westgevel vernieuwd. Nicolaas van Breyll liet in 1651 beide beuken verhogen en de bakstenen trapgevels aan de koorzijde optrekken. De twee mergelstenen cartouches in de zuidelijke trapgevel tonen de wapens van Nicolaas van Breyll en pastoor Nicolaus Nagel. Bij het koor zijn restanten te zien van twee ingekraste middeleeuwse zonnewijzers. Tijdens de exterieurrestauratie in 1953-''54, onder leiding van F.P.J. Peutz, zijn enkele aanbouwen verwijderd, zoals de sacristie uit 1817 tegen het koor.', 51.0157, 5.83884, 'Limbricht', 'Limburg', 'Platz', '2', '13e eeuw (koor)', 1300, NULL, '{"opgetrokken": 2, "bewaard": 1, "leiding": 1, "maaskeien": 2, "parochiekerk": 1, "1953-''54": 1, "zuidbeuk": 1, "mergelstenen": 2, "wapens": 1, "nagel": 1, "platz": 1, "het": 5, "enkele": 2, "dichtgemetseld": 1, "voormalige": 1, "stijl": 1, "ook": 1, "koorzijde": 1, "verhogen": 1, "aan": 1, "nicolaus": 1, "aanbouwen": 1, "exterieurrestauratie": 1, "2": 1, "trapgevel": 1, "trapgevels": 1, "1817": 1, "bij": 2, "liet": 1, "drie": 1, "eeuw": 1, "tijdens": 1, "de": 15, "beuken": 1, "twee": 2, "boogfriezen": 1, "vijfzijdig": 1, "bakstenen": 1, "peutz": 1, "restanten": 1, "geledingen": 1, "11de-eeuwse": 2, "zonnewijzers": 1, "eerste": 1, "oude": 1, "zien": 1, "f.p.j": 1, "sporenkap": 1, "heeft": 1, "westgevel": 