(36769, 88, 'Kasteel Valkenburg op de Heunsberg', 'Kasteel Valkenburg (Grendelplein 13) is een indrukwekkende burchtru&iuml;ne op driehoekige plattegrond, gelegen op de Heunsberg. Thibalt van Voeren liet hier rond 1087 een eerste versterking aanleggen in de vorm van een rechthoekige donjon, waarvan de bouw rond 1115 werd voortgezet door zijn opvolger Gosewijn I van Heinsberg. Deze donjon werd al in 1122 verwoest en vervolgens rond 1170 herbouwd in een zestienhoekige vorm. Na de verwoesting van dit bouwwerk in 1214 volgde de bouw van een kleinere tienhoekige don-jon. Toen verrees ook een oostvleugel ter plaatse van de huidige onderbouw van de ridderzaal. De derde donjon maakte in de tweede helft van de 13de eeuw plaats voor een zuidvleugel in opdracht van Diederik II van Kleef of zijn zoon Walram. Gelijktijdig begon men met het uithakken van de dwingel (Van Meijlandstraat) - een verdedigbare toegangsweg - waardoor men de Heunsberg van het plateau van Margraten scheidde wat de hoogteburcht beter verdedigbaar maakte. Toch werd de burcht in 1329 opnieuw verwoest. Deze werd door Diederik IV in gotische stijl herbouwd tot een fors L-vormig complex met een kleine traptoren in de binnenhoek, een ridderzaal (oostzijde) en een kapel (noordzijde). Verdere uitbreidingen en versterkingen volgden in de 15de eeuw; zo werd de dwingel in 1464-''65 verder uitgediept. Mogelijk ontstonden toen ook de - in 1937 ontdekte - onderaardse gangen die in de Fluwelen Grot uitkomen.', 50.8619, 5.8319, 'Valkenburg', 'Limburg', 'Grendelplein', '13', '14e-15e eeuw (muurgedeelten)', 1500, 'Kasteel Valkenburg', '{"zoon": 1, "margraten": 1, "uitbreidingen": 1, "door": 2, "valkenburg": 3, "kleinere": 1, "onderbouw": 1, "beter": 1, "of": 1, "uitkomen": 1, "toegangsweg": 1, "het": 2, "bouwwerk": 1, "tienhoekige": 1, "gelijktijdig": 1, "1464-''65": 1, "zuidvleugel": 1, "1329": 1, "op": 3, "stijl": 1, "ook": 2, "toch": 1, "fors": 1, "1087": 1, "-": 4, "ontdekte": 1, "don-jon": 1, "helft": 1, "onderaardse":